import styled from "styled-components";

export const CampaingPageContainer = styled.div`
  width: 100%;
  display: flex;
  flex-direction: column;
  height: 100vh;
  transition: top;

  @media screen and (max-width: 750px) {
   height: 92vh;
  }
`

export const TabsContainer = styled.div`      
  display: flex;
  align-items: center;

  @media screen and (max-width: 750px) {
    margin: 10px;
  }
`

export const ContentContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  flex-wrap: wrap;
  gap: 30px;
  overflow: auto;

  @media screen and (max-width: 750px) {
    padding: 0px;
  }
`

export const Header = styled.div`

`
